import React from 'react'
import './Tile.style.css';

const Tile = ({details}) => {
  return( 
  <div onClick={() => console.log(details)} style={style.tileStyle}>
    {details.value}
  </div>
    
  )
};
const style = {
  tileStyle:{
    width:40, height:40, background: "grey",
    display:'flex',
    justifyContent:'center',
    alignItems:'center'

  }
}
export default Tile
